import React from "react";
import { MapContainer, TileLayer } from "react-leaflet";
import "./map.css"; // Importe o arquivo CSS externo

function Map() {
  return (
    <div className="map-container">
      <MapContainer center={[51.505, -0.09]} zoom={13}>
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
        <TileLayer url="https://api.mapbox.com/styles/v1/{id}/tiles/{z}/{x}/{y}?access_token={accessToken}" 
          attribution='Map data &copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors, Imagery &copy; <a href="https://www.mapbox.com/">Mapbox</a>'
          id="mapbox/streets-v11" // ID do estilo do MapBox
          accessToken="YOUR_MAPBOX_ACCESS_TOKEN" // Substitua pelo seu token do MapBox
        />
      </MapContainer>
    </div>
  );
}

export default Map;
